    /**
     * This method converts the content of a source file into Base64 encoded data and saves that to a target file.
     * If isChunked parameter is set to true, there is a hard wrap of the output  encoded text.
     */
    public static void encode(String sourceFile, String targetFile, boolean isChunked) throws Exception {
 
        byte[] base64EncodedData = Base64.encodeBase64(loadFileAsBytesArray(sourceFile), isChunked);
 
        writeByteArraysToFile(targetFile, base64EncodedData);
    }
    public static void decode(String sourceFile, String targetFile) throws Exception {
    	 
        byte[] decodedBytes = Base64.decodeBase64(loadFileAsBytesArray(sourceFile));
 
        writeByteArraysToFile(targetFile, decodedBytes);
    }
    
    
    public static String encodeToString(String sourceFile, boolean isChunked) throws Exception {
    	 
        byte[] base64EncodedData = Base64.encodeBase64(loadFileAsBytesArray(sourceFile), isChunked);
        return new String(base64EncodedData); 
    }
    
    public static byte[] decodeToByteArray(String sourceFile) throws Exception {

//    	boolean isBase64 = Base64.isBase64(sourceFile);
        boolean isBase64 = Base64.isArrayByteBase64(sourceFile.getBytes());
    	if(isBase64)
    	{
    		String pattern = "^(?:[A-Za-z0-9+/]{4})*(?:[A-Za-z0-9+/]{2}==|[A-Za-z0-9+/]{3}=)?$";
            // Create a Pattern object
            Pattern r = Pattern.compile(pattern);

            // Now create matcher object.
            Matcher m = r.matcher(sourceFile);
            if (m.find( )) 
            {
            	logger.info("DFS Webservice : isBase64 : Matched");
            	byte[] decodedBytes = Base64.decodeBase64(sourceFile.getBytes());
                return decodedBytes;
            } 
            else 
            {
            	logger.info("DFS Webservice : isBase64 : Not Matched : Returned null");
            	return null;
            }
    	}
    	else
    	{
    		logger.info("DFS Webservice : isBase64 : "+ isBase64 + "  : Returned null");
    		return null;
    	}
    	
    }
 
    /**
     * This method loads a file from file system and returns the byte array of the content.
     *
     * @param fileName
     * @return
     * @throws Exception
     */
    public static byte[] loadFileAsBytesArray(String fileName) throws Exception {
 
    	 BufferedInputStream reader =null;
    	 byte[] bytes = null;
        try {
        	 File file = new File(fileName);
             int length = (int) file.length();
              reader = new BufferedInputStream(new FileInputStream(file));
              bytes= new byte[length];
             reader.read(bytes, 0, length);
			
		} catch (Exception e) {
		}finally {
			if(reader!=null) {
			 reader.close();
			}
		}
        return bytes;
    }
 
    /**
     * This method writes byte array content into a file.
     *
     * @param fileName
     * @param content
     * @throws IOException
     */
    public static void writeByteArraysToFile(String fileName, byte[] content) throws IOException {
    	 BufferedOutputStream writer =null;
    	 OutputStream out=null;
    	 try {
    		    File file = new File(fileName);
    		    out=new FileOutputStream(file);
    	        writer=new BufferedOutputStream(out);
    	        writer.write(content);
		} catch (Exception e) {
			
		}finally {
			if(writer!=null) {
				try {
					writer.flush();
		            writer.close();
				} catch (Exception e2) {
				}
				
			}
			if(out!=null) {
				try {
					out.close();
				} catch (Exception e2) {
					
				}
				
			}
			
		}
 
    }
